textOriginal:
Só no Brasil que um condenado em 3 instancias é candidato a presidencia,tem seguidores,uns até o idolatram e ainda tem uma midia prostituta que faz papel de cabo eleitoral para ele.
É o poste fazendo xixi no cachorro,
Pior,essa midia perdeu tanto a credibilidade,que tem que pegar cortes de um podcast;
